import '../../App.css';
import SmoothScroll from '../SmoothScroll/SmoothScroll';
import { Link } from 'react-router-dom';
import '../Section/Section.css';
import '../Cards.css';
import foto from '../../images/earth.gif';
import './Projects.css';
import videoProjects from '../../video/video_projects.mp4';



export default function Products() {

    useEffect(() => {
      window.scrollTo(0, 0)
    }, [])
    return (

    <>
    <div className="proj-intro">
          <h2 className="proj-intro-title"> Our Projects </h2>
          <video className='videoTag' autoPlay loop muted>
              <source src={videoProjects} type='video/mp4' />
          </video>
          <h6 className="proj-intro-links"> Video by cottonbro from Pexels</h6>
      </div>

      <div className="home-sec" >
        <div className="description-leftProjects">
          <img src={foto} className="placeimg"></img>
        </div>
        <div className="description-posProjects">
          <div className="cardprojects">
            <p>DVox is an application where Anim non voluptate veniam sint veniam labore tempor cillum sint. Est sint culpa enim id consequat ipsum proident. Est aliqua id est elit est adipisicing nulla. Excepteur dolor nulla excepteur eiusmod irure laborum pariatur commodo consectetur ipsum consectetur labore fugiat excepteur. Ut enim consectetur nostrud pariatur fugiat qui deserunt occaecat et reprehenderit et anim.</p>
            <Link to='/dvox'>
              Learn more about DVox
            </Link>
          </div>
        </div>

        <div className="description-leftProjects">
          <img src={foto} className="placeimg"></img>
        </div>
        <div className="description-posProjects">
          <div className="cardprojects">
            <p>Computer Science Society is where Anim non voluptate veniam sint veniam labore tempor cillum sint. Est sint culpa enim id consequat ipsum proident. Est aliqua id est elit est adipisicing nulla. Excepteur dolor nulla excepteur eiusmod irure laborum pariatur commodo consectetur ipsum consectetur labore fugiat excepteur. Ut enim consectetur nostrud pariatur fugiat qui deserunt occaecat et reprehenderit et anim.</p>
            <Link to='/css'>
              Learn more about CSS
            </Link>
          </div>
        </div>
      </div>

    </>

  )

}
